import React from 'react';
import cls from "../sign.module.scss";

const MyInput = ({  }) => {
    return (
        <label>
            <span className={cls.label}>Ism familiya</span>
            <input className={cls.inp} type="text"/>
        </label>
    );
};

export default MyInput;
